  input: 'TEXT,F3XA,,"Dear Jodi Winship - In reference to your letter dated August
    31, 2007, American Bakers PAC is filing the attached  Amended July 31 Mid Year
    Report.  The amended report corrects our mistake of filing voided political contributions
    as refunds on Schedule A Line 16.  Per your instructions in the August 31 letter,
    those voided political contributions totaling $5,250 are now itemized on Schedule
    B Line 23 as negative disbursements.  We sincerely apologize for our mistake and
    thank the Commission for allowing us the opportunity to rectify the situation.  Per
    our phone conversation today, September 28, 2007 at 1:40p.m., I understand that
    uploading the electronic amended report is all that is required and there is no
    need for American Bakers PAC to send in a formal hard copy letter in response
    to the Commission.  Thank you again for your accessibility and professionalism.
    - Kelly Knowles, American Bakers PAC, ID # C-00016386  "'
